import React from "react";

function ResultPage({ setStep, formData }) {
  return (
    <div className="page">
      <h2>Results</h2>
      <p><b>Monthly Payment:</b> £ xxx (until xx/xx/xxxx)</p>
      <p><b>Total Interest:</b> £ xxx</p>
      <p><b>Total Payment:</b> £ xxx</p>

      <button>See how much you can borrow</button>
      <button onClick={() => setStep(2)}>Back</button>
    </div>
  );
}

export default ResultPage;
